}

export default function MovieBox(props:Props) {
    
    return (
        <div className="movieBox" onClick={() => {/* På klikk vil jeg displaye movieInformation */}}>
            <div id="movieBox_grid">
                {/*<img id="movieBox_cover" src={props.imgUrl} alt="Movie cover"/>*/}
